// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract EduBoxERC20 is ERC20, ERC20Burnable, Pausable, Ownable {
    using SafeMath for uint256;

    uint8 private _decimals;
    mapping(address => bool) public blacklist;
    uint256 public maxTransferAmount;
    bool public transferFeeEnabled;
    uint256 public transferFeePercentage;
    address public feeCollector;

    string public logoURL;
    string public website;
    string public socialMediaLinks;

    uint256 public immutable cap;

    event Blacklisted(address indexed account, bool status);
    event MaxTransferAmountUpdated(uint256 amount);
    event TransferFeeUpdated(bool enabled, uint256 percentage);
    event FeeCollectorUpdated(address indexed newCollector);
    event MetadataUpdated(
        string logoURL,
        string website,
        string socialMediaLinks
    );

    constructor(
        string memory name,
        string memory symbol,
        uint8 tokenDecimals,
        uint256 initialSupply,
        uint256 _cap,
        address owner,
        string memory _logoURL,
        string memory _website,
        string memory _socialMediaLinks
    ) ERC20(name, symbol) {
        require(_cap > 0, "EduBoxERC20: cap is 0");
        require(
            initialSupply <= _cap,
            "EduBoxERC20: initial supply exceeds cap"
        );

        _decimals = tokenDecimals;
        cap = _cap;
        _mint(owner, initialSupply);
        transferOwnership(owner);
        maxTransferAmount = type(uint256).max;
        feeCollector = owner;

        logoURL = _logoURL;
        website = _website;
        socialMediaLinks = _socialMediaLinks;
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }

    function mint(address to, uint256 amount) public onlyOwner {
        require(totalSupply() + amount <= cap, "EduBoxERC20: cap exceeded");
        _mint(to, amount);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function setBlacklist(address account, bool status) public onlyOwner {
        blacklist[account] = status;
        emit Blacklisted(account, status);
    }

    function setMaxTransferAmount(uint256 amount) public onlyOwner {
        maxTransferAmount = amount;
        emit MaxTransferAmountUpdated(amount);
    }

    function setTransferFee(bool enabled, uint256 percentage) public onlyOwner {
        require(percentage <= 100, "Fee percentage must be between 0 and 100");
        transferFeeEnabled = enabled;
        transferFeePercentage = percentage;
        emit TransferFeeUpdated(enabled, percentage);
    }

    function setFeeCollector(address newCollector) public onlyOwner {
        require(newCollector != address(0), "Invalid fee collector address");
        feeCollector = newCollector;
        emit FeeCollectorUpdated(newCollector);
    }

    function updateMetadata(
        string memory _logoURL,
        string memory _website,
        string memory _socialMediaLinks
    ) public onlyOwner {
        logoURL = _logoURL;
        website = _website;
        socialMediaLinks = _socialMediaLinks;
        emit MetadataUpdated(_logoURL, _website, _socialMediaLinks);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        require(
            !blacklist[sender] && !blacklist[recipient],
            "Blacklisted address"
        );
        require(amount <= maxTransferAmount, "Transfer amount exceeds maximum");

        if (transferFeeEnabled && sender != owner() && recipient != owner()) {
            uint256 feeAmount = amount.mul(transferFeePercentage).div(100);
            uint256 transferAmount = amount.sub(feeAmount);
            super._transfer(sender, feeCollector, feeAmount);
            super._transfer(sender, recipient, transferAmount);
        } else {
            super._transfer(sender, recipient, amount);
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override whenNotPaused {
        super._beforeTokenTransfer(from, to, amount);
    }
}

contracts/EduBoxERC20Factory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./EduBoxERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract EduBoxERC20Factory is Ownable {
    uint256 public constant CREATION_FEE = 1 ether;
    address public feeRecipient;
    struct TokenInfo {
        address tokenAddress;
        string name;
        string symbol;
        address owner;
    }

    TokenInfo[] public createdTokens;

    event FeeRecipientUpdated(address indexed newRecipient);

    event TokenCreated(
        address indexed tokenAddress,
        string name,
        string symbol,
        address indexed owner
    );

    constructor() {
        feeRecipient = 0x1fcb879Bf709ccDfc2C2CFB39aFD836a63612e58;
    }

    function createToken(
        string memory name,
        string memory symbol,
        uint8 decimals,
        uint256 initialSupply,
        uint256 cap,
        string memory logoURL,
        string memory website,
        string memory socialMediaLinks
    ) external payable {
        require(msg.value >= CREATION_FEE, "Insufficient creation fee");
        require(bytes(name).length > 0, "Name cannot be empty");
        require(bytes(symbol).length > 0, "Symbol cannot be empty");
        require(initialSupply > 0, "Initial supply must be greater than 0");
        require(
            cap >= initialSupply,
            "Cap must be greater than or equal to initial supply"
        );

        // Transfer fee to recipient
        payable(feeRecipient).transfer(CREATION_FEE);

        // Refund excess
        if (msg.value > CREATION_FEE) {
            payable(msg.sender).transfer(msg.value - CREATION_FEE);
        }

        EduBoxERC20 newToken = new EduBoxERC20(
            name,
            symbol,
            decimals,
            initialSupply,
            cap,
            msg.sender,
            logoURL,
            website,
            socialMediaLinks
        );

        createdTokens.push(
            TokenInfo({
                tokenAddress: address(newToken),
                name: name,
                symbol: symbol,
                owner: msg.sender
            })
        );

        emit TokenCreated(address(newToken), name, symbol, msg.sender);
    }

    function setFeeRecipient(address _newRecipient) external onlyOwner {
        require(_newRecipient != address(0), "Invalid address");
        feeRecipient = _newRecipient;
        emit FeeRecipientUpdated(_newRecipient);
    }

    function getTokenCount() public view returns (uint256) {
        return createdTokens.length;
    }

    function getTokenInfo(
        uint256 index
    ) public view returns (TokenInfo memory) {
        require(index < createdTokens.length, "Token index out of bounds");
        return createdTokens[index];
    }

    function getCreatedTokens(
        uint256 start,
        uint256 end
    ) public view returns (TokenInfo[] memory) {
        require(start < end, "Invalid range");
        require(end <= createdTokens.length, "End out of bounds");

        TokenInfo[] memory tokens = new TokenInfo[](end - start);
        for (uint256 i = start; i < end; i++) {
            tokens[i - start] = createdTokens[i];
        }
        return tokens;
    }

    function withdrawFees() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

